//initializes the ai_deck  
void initializer(){
	int i;
    //ai deck
    for( i = 0; i < (sizeof(ai_deck)/sizeof(ai_deck[i]));i++){
        card_generator();
        ai_deck[i] = random_card;

        if (i > 4){
            ai_deck[i].colour = 4;
            ai_deck[i].number = 2;
        }
            
    }
    //user deck
    for( i = 0; i < (sizeof(user_deck)/sizeof(user_deck[i]));i++){
        card_generator();
        user_deck[i] = random_card;

        if (i > 4){
            user_deck[i].colour = 4;
            user_deck[i].number = 2;
        }
            
    }  
    //currentcard
    curr_card.colour = rand()%4;
    curr_card.number =  rand()%12;      
}


int read_until_get_key()
{
	int data;
	
	do {
			data = read_key();
		}while(data == 0);
		
	return data;
}


void read_until_key_clear()
{
	int temp;
	//clean key input
	do {
	 	temp = read_key();
		}while(temp != 0);	
}

int read_key()
{
	volatile int keys_reading;
	
	volatile int * keys_ptr;
	
	keys_ptr = (int *)0xFF20005C;	
	keys_reading = *keys_ptr;	
	if(keys_reading != 0)
		*keys_ptr = keys_reading;	//clear key edge if there is data	
	//printf(" keys pointer = %p, \n ", keys_ptr );			
	//printf(" keys_read  = %x, \n ", keys_reading );	
	
	return keys_reading;
}

void update_card_selection()
{
	int i;
	int select_temp;	
	
	volatile int current_switch;
	
	current_switch = read_switch();
	if(current_switch != previous_switch_reading)
	{		
		previous_switch_reading = current_switch;
		clear_user_deck(); 
		for (i = 0; i < 10 ; i++)
		{
			select_temp = current_switch >> i ;
			select_temp = select_temp & 0x0001;
			user_deck[i].ifSelected = select_temp ;
		}		
	}	
	display_user_deck();	
}

int read_switch()
{
	volatile int switch_reading;
	
	volatile int * switch_ptr;
	
	switch_ptr = (int *)0xFF200040;	
	switch_reading = *switch_ptr;	
	
	//printf(" keys pointer = %p, \n ", keys_ptr );			
	//printf(" switch_read  = %x, \n ", switch_reading );	
	
	return switch_reading;
}

