void draw_back(int orgX, int orgY)
{
	int i, j;
	int data ;	
	
	for (i = 0; i < CARD_HEIGHT ; i++)
	{		
		for(j=0 ; j < CARD_WIDTH; j++)	
		{ 	
			data = card_back[(i*CARD_WIDTH+j)*2+1] ;
			data = data << 8;
			data += card_back[(i*CARD_WIDTH+j)*2];	
			plot_pixel(orgX+j, orgY+i, data);
			//printf(" x, y  = %d, %d,   data = %x, \n ", j, i,data );
		}		
	}
}


void draw_card(int orgX, int orgY, int color, int number)
{
	// 
	int i, j;
	int Pos, data ;
	
	Pos = color * COLOUR_SIZE + number * CARD_SIZE ;
	for (i = 0; i < CARD_HEIGHT ; i++)
	{		
		for(j=0 ; j < CARD_WIDTH; j++)	
		{ 	
			data = card_lib[Pos+(i*CARD_WIDTH+j)*2+1] ;
			data = data << 8;
			data += card_lib[Pos+(i*CARD_WIDTH+j)*2];	
			plot_pixel(orgX+j, orgY+i, data);
			//printf(" x, y  = %d, %d,   data = %x, \n ", j, i,data );
		}		
	}
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void clear_area(int x_start, int y_start, int x_end, int y_end)
{
	int x, y;
	
	for (x=0; x < (x_end - x_start+ 1); x++)
	{
		for( y=0; y < ( y_end - y_start + 1 ); y++)
			plot_pixel( x_start + x,   y_start + y, 0x0000); 
	}
}


void clear_screen()
{
	int x, y;
	for (x=0; x < RESOLUTION_X; x++)
	{
		for( y=0; y< RESOLUTION_Y; y++)
			plot_pixel( x,  y, 0x0000); //0x001F);// test blue 0x0000);
	}
}

//char_print need to be in format of ASCII
void print_char(int x, int y,  char char_print)
{
    *( char *)(char_buffer_start + (y << 7) + x ) = char_print;
}

void clear_character_all()
{
	int x, y;
	for (x = 0; x < CHAR_RESOLUTION_X; x++)
	{
		for( y = 0; y < CHAR_RESOLUTION_Y; y++)
			print_char( x,  y, 0x20); //wirte 0x20 to fill blank space
	}
}

void clear_character(int x_start, int y_start, int x_end,int y_end)
{
	int x, y;
	for (x = 0; x < (x_end - x_start+ 1); x++)
	{
		for( y = 0; y < ( y_end - y_start + 1 ) ; y++)
			print_char( x_start + x,  y_start + y, 0x20); //wirte 0x20 to fill blank space
	}
}

void print_message(int x, int y, char * char_data)
{
	 char *data_ptr;
	int i;
	
	data_ptr = char_data;
	i = x;
	while (*data_ptr)
	{
	 print_char( i,  y, *data_ptr);	
	 i++;
	 if(i > (CHAR_RESOLUTION_X - 2)) //if message almost reach the end change to next line
	 {
		i = x ;
		y += 1;	
	 }
	 data_ptr++;
	}

}



//this bot only knows how to play number cards
//it will not use any skip cards, colour changing cards, or plus cards
//will always take in cards for plus cards
//will always take an extra card if there is no fit for colour changing cards
//will not stack any special cards
void bot(){
    for (int i = 0; i < sizeof(ai_deck)/sizeof(ai_deck[i]); i++){
        //if its a regular number card
        if((curr_card.colour == ai_deck[i].colour || curr_card.number == ai_deck[i].number) 
        && (((0 <= curr_card.colour)&&(curr_card.colour <= 3) && (0 <= curr_card.number)&&(curr_card.number <= 9)))){
            //play the card
            curr_card.colour = ai_deck[i].colour;
            curr_card.number = ai_deck[i].number;
            shift_card(ai_deck, i);
            break;   
        }
        //if its a black card
        if(prev_card.colour == 4){
            //if its change colour
            if(prev_card.number == 0){
                //bot must put down the right colour otherwise plus 1
                if(ai_deck[i].colour == curr_card.colour ){
                    curr_card.colour = ai_deck[i].colour;
                    curr_card.number = ai_deck[i].number;
                    shift_card(ai_deck, i);
                    break;
                }
                //or else it plays a colour change/+4 card as well
                else if(ai_deck[i].colour == 4){
                    int index2= rand() % (sizeof(colours) / sizeof(int));
                    random_card.colour = colours[index2];
                    colour_changed = random_card.colour;
                    if(ai_deck[i].number == 1){
                        curr_card.colour = ai_deck[i].colour;
                        curr_card.number = ai_deck[i].number;
                    }
                    break;

                }
                else{
                    plusone_easy(ai_deck);
                    break;
                }
            }
            //if its plus four (includes change colour)
            if(curr_card.number == 1){
                //adds four to ai deck
                plusfour_easy();
                //must also find the right colour to put
                break;
            }
        }
        // if its skip or plus two
        if(curr_card.number >= 10 && curr_card.number <= 11){
            // if its skip
            if(curr_card.number == 10){
                //skips the bots turn
                break;
            }
            //if its plus 2
            if(curr_card.number == 11){
                    plustwo_easy();
                    break;
            }
        }
        
    }
    bot_turn = false;
}



